class Solution:
    def findNumOfValidWords(self, words, puzzles):
        class Node:
            def __init__(self, val):
                self.val = val
                self.child = [None for _ in range(26)]

        root = Node(0)

        def insert(w):
            w = list(set(w))
            if len(w) > 7:
                return
            w.sort()
            cur = root
            for c in w:
                # print(c, w)
                index = ord(c) - 97
                if cur.child[index] == None:
                    cur.child[index] = Node(0)
                cur = cur.child[index]
            cur.val += 1

        for w in words:
            insert(w)

        # print(root.child[0].val)
        ans = []

        def check(p):
            possible = [[p[0]]]
            start = p[0]
            S = p[1:]

            def perm(s, m, ret):
                if m == 0:
                    A = list(start + ret)
                    A.sort()
                    possible.append(A)
                    return
                if len(s) > 0:
                    ret += s[0]
                    perm(s[1:], m - 1, ret)
                    perm(s[1:], m, ret[:-1])

            for i in range(1, len(p)):
                perm(S, i, '')

            ans = 0
            for p in possible:
                cur = root
                for c in p:
                    # print(c, p)
                    index = ord(c) - 97
                    if cur.child[index] == None:
                        break
                    cur = cur.child[index]
                else:
                    ans += cur.val
            return ans

        for p in puzzles:
            ans.append(check(p))
        return ans

